const MessageContainer = ({ messages }) => {
    return (
      <div>
        <table striped bordered>
          <thead>
            <tr>
              <th>Message</th>
              <th>Utilisateur</th>
            </tr>
          </thead>
          <tbody>
            {messages.map((message, index) => (
              <tr key={index}>
                <td>{message.message}</td>
                <td>{message.username}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };
export default MessageContainer;
